// SPDX-License-Identifier: MIT
pragma solidity 0.8.28;
pragma experimental ABIEncoderV2; // Tambahkan ini

contract Tracking {
    struct Shipment {
        string trackingId;
        string date;
        string status;
        address owner;
    }

    mapping(string => Shipment) private shipments;
    string[] private allTrackingIds;

    event ShipmentAdded(string trackingId, string date, string status, address indexed owner);
    event ShipmentStatusUpdated(string trackingId, string newStatus);

    function addShipment(string memory _trackingId, string memory _date, string memory _status) public {
        require(bytes(shipments[_trackingId].trackingId).length == 0, "Tracking ID exists");

        shipments[_trackingId] = Shipment(_trackingId, _date, _status, msg.sender);
        allTrackingIds.push(_trackingId); // Tambahkan ini

        emit ShipmentAdded(_trackingId, _date, _status, msg.sender);
    }

    function updateShipmentStatus(string memory _trackingId, string memory _newStatus) public {
        require(bytes(shipments[_trackingId].trackingId).length != 0, "Tracking ID does not exist");
        require(shipments[_trackingId].owner == msg.sender, "Only owner can update");

        shipments[_trackingId].status = _newStatus;
        emit ShipmentStatusUpdated(_trackingId, _newStatus);
    }

    function getShipment(string memory _trackingId) public view returns (Shipment memory) {
        require(bytes(shipments[_trackingId].trackingId).length != 0, "Tracking ID not found");
        return shipments[_trackingId];
    }

    function getAllShipments() public view returns (Shipment[] memory) {
        Shipment[] memory allShipments = new Shipment[](allTrackingIds.length);
        for(uint i = 0; i < allTrackingIds.length; i++) {
            allShipments[i] = shipments[allTrackingIds[i]];
        }
        return allShipments;
    }
}

